### Guidance

To find the average of a set of numbers, you divide the sum of the numbers by the count of numbers. In the previous concept, we found the mean, median, and mode of a set of numbers. Mean is the same as average.

#### Example A

Find the average of the following set of numbers: {7, 12, 13, 5, 18}.

Solution:

\[ \text{average}&=\frac{\text{sum of the numbers}}{\text{count of numbers}}\\\text{average}&=\frac{7+12+13+5+18}{5}\\\text{average}&=\frac{55}{5}\\\text{average}&=11 \]

#### Example B

A student received the following scores on his math tests for the quarter: {75, 86, 92, 88, 90}. Find his average score for the quarter.

Solution:

\[ \text{average}&=\frac{\text{sum of the numbers}}{\text{count of numbers}}\\\text{average}&=\frac{75+86+92+88+90}{5}\\\text{average}&=\frac{431}{5}\\\text{average}&=86.2 \]

#### Example C

Find the average of the following set of numbers: {3, 2, 5, 6, 7, 8, 9, 10, 11}.

Solution:

\[ \text{average}&=\frac{\text{sum of the numbers}}{\text{count of numbers}}\\\text{average}&=\frac{3+2+5+6+7+8+9+10+11}{9}\\\text{average}&=\frac{61}{9}\\\text{average}&\approx 6.78 \]

Notice that in Example C, the average is not a whole number. This is okay. In this case, the average is a decimal.

### Vocabulary

Average
    Average means the same as mean. It is the sum of a set of numbers divided by the count of numbers in the set.

